import React from 'react';

import moment from 'moment';
import { useSelector } from 'react-redux';

import {
  CircularProgress,
  TableBody as TableBodyMui,
  TableCell,
  TableRow,
} from '@mui/material';
import { makeStyles } from '@mui/styles';

import { RootState } from '../../store/store';
import { tableDataType } from '../../store/types';

const useStyles = makeStyles({
    table_row: {
        border: '1px solid #E3E6EC',
    },

    secondary_text: {
        color: 'grey',
    },
});


function TableBody(): React.ReactElement {
    const classes = useStyles();
    const tableData = useSelector((state: RootState) => state.tableData.data)
    const isLoading = useSelector((state: RootState) => state.tableData.isLoading)

    return (
        <TableBodyMui>
            {isLoading && <CircularProgress />}
            {!isLoading && !!tableData.length &&
                tableData.map((data: tableDataType) => <TableRow key={data.id}>
                    <TableCell className={classes.table_row}>
                        <p>â„–{data.id}</p>
                        <p>{moment(data.created_date).format('DD.MM.yyyy HH:mm')}</p>
                    </TableCell>
                    <TableCell className={classes.table_row}>
                        <p>{data.order_type.name}</p>
                        <p className={classes.secondary_text}>{data.created_user.surname} {data.created_user.name[0]}. {data.created_user.patronymic[0]}.</p>
                    </TableCell>
                    <TableCell className={classes.table_row}>
                        <p>{data.account.name}</p>
                        <p>{data.terminal.name}</p>
                    </TableCell>
                    <TableCell className={classes.table_row}>
                        <p>{data.status}</p>
                    </TableCell>
                </TableRow>)}
        </TableBodyMui>
    );
}

export default TableBody;
